import { BrowserRouter as Router, Route } from "react-router-dom";

const Main = () => {
  return (
    <>
      <Nickname
        onPickNickname={(nickname) => {
          setNickname(nickname);
        }}
        nickname={nickname}
      />
    </>
  );
};

export default Main;
